function [interpolatedValues] = BicubicInterpolation(V,phi,lambda,x_min,y_min,cellsize)
ncols=size(V,2);
nrows=size(V,1);
n = length(phi);
interpolatedValues=zeros(n,1);

[ind_col,ind_row] = FindCell(phi,lambda,ncols,nrows,x_min,y_min,cellsize);

for i=1:n

F = FindNeighbors(V,ind_col(i),ind_row(i));
B = [-1/16,9/16,9/16,-1/16];

interpolatedValues(i)=B*F*B';

end



end



function [neighbors] = FindNeighbors(V,ind_col,ind_row)

ncols=size(V,2);
nrows=size(V,1);
neighbors = NaN(4,4);


% the function is not dealing with points located on the corners or the
% edges
if (ind_col>1) && (ind_row>1) && (ind_col<=(ncols-2)) && (ind_row<=(nrows-2))
    neighbors = V(ind_row-1:ind_row+2,ind_col-1:ind_col+2);
end

nanInd = isnan(V);

if sum(sum(nanInd))>0 && sum(sum(nanInd))<16

    neighbors(nanInd) = mean(neighbors(~nanInd));

end

end







function [i_col,i_row] = FindCell(x,y,ncols,nrows,x_min,y_min,cellsize)

dx = x - x_min;
dy = y - y_min;

x_max = x_min+cellsize*(ncols-1);
y_max = y_min+cellsize*(nrows-1);

i_col = 1+floor((dx/(x_max-x_min))*(ncols-1));
i_row = 1+floor((dy/(y_max-y_min))*(nrows-1));


end






